import React, {Component} from 'react';

class ImageCard extends Component {
    render() {
        const {urls,description}=this.props.images;
        return (
           <React.Fragment>
               <img
                   src={urls.regular}
                   alt={description}
               />
           </React.Fragment>
        );
    }
}

export default ImageCard;
